import React from 'react'
import './StorySearch.css'


$("#btnLogOut").keyup(function (event) {
  if (event.which == 13 || event.keyCode == 13) {
      alert(event.keyCode);
      $("#btnLogOut").preventDefault();
      return false;
  }
  else return true;
}); 

const StorySearch = (props) => {
  const { handleSearchInput } = props
  return (
    <form className='search-bar-container' onSubmit={(event) => event.preventDefault()}
    >
      <input
        className='search-bar'
        type='text'
        placeholder='Search Stories'
        onSubmit={(event) => event.preventDefault(event)}
        onChange={handleSearchInput}
      />
    </form>

  )
}

export default StorySearch
